import './App.css';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Demo from './pages/Demo';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Route path="/" component={Demo} />
      </BrowserRouter>
    </div>
  );
}

export default App;
